import React from "react";
import CategorySubPage from "../components/CategorySubPage";
import ChallengesTable from "../components/ChallengesTable";
import challengeData from "../challengeData";


const WebExploitationChallenges = () => {
 
  const webExploitationChallenges=challengeData.webExploitation || []

  const challenges = webExploitationChallenges.map( challenge => ({
    id: challenge.id,
    name: challenge.title,
    difficulty: challenge.difficulty || "N/A",
    points: challenge.points || 100,
    completed: localStorage.getItem(`challenge_${challenge.id}_completed`) === 'true',
    path: `/web-exploitation/challenges/${challenge.id}`
  }))

  const challengesContent = challenges.length > 0 ? (
    <ChallengesTable
      challenges={challenges}
      categoryPath="/web-exploitation"
    />
  ) : (
    <p>No challenges available at the moment.</p>
  );
  return (
    <CategorySubPage
      title="Web Exploitation Challenges"
      content={challengesContent}
      buttons={[
        {
          text: "Back to Overview",
          path: "/web-exploitation",
          variant: "secondary",
        },
      ]}
    />
  );
};

export default WebExploitationChallenges;
